import React, { Component } from 'react'

type TagPorps = {
    title: string[];
}

type TagState ={}

export default class Tag extends Component<TagPorps, TagState> {
  render() {
    return (
        <div className='px-6 py-2 border-2 border-stone-700 rounded cursor-pointer'>
            <h4 className='font-bold'>{this.props.title[2]}</h4>
            
        </div>
    )
  }
}
